import React, { Component } from 'react';
import { Tabs, Tab } from 'reach-mdl';

class Projects extends Component {
    constructor(props) {
        super(props);
        this.state = { activeTab: 0 };
    }
    render() {
        return (
            <div className="category-tabs">
                <Tabs activeTab={this.state.activeTabTab} onChange={(tabId) => this.setstate({ activeTab: tabId })} ripple>
                    <Tab>React</Tab>
                    <Tab>Angular</Tab>
                    <Tab>VueJS</Tab>
                    <Tab>MongoDB</Tab>
                </Tabs>
            </div>
        )
    }
}

export default Projects;
